import React, { useState } from "react";
import { Button } from "react-bootstrap";

function Weather() {
  return (
    <>
      <div className="mb-2">
        <Button variant="primary">Search</Button>
        <Button variant="primary">Current</Button>
      </div>
    </>
  );
}
export default Weather;
